риказати и штампати.","sk":"Zoznam všetkých kontaktov s príslušnou menou. Výpisy z účtov môžu byť tiež zobrazené a vytlačené.","sl":"Seznam vseh stikih z njihovo ustrezno valuto. Izpiski računa se lahko prikaže in natisne.","es":"Lista de todos los contactos con su moneda correspondiente. Los estados de cuenta también se pueden mostrar e imprimir.","sv":"Lista över alla kontakter med motsvarande valuta. Kontoutdrag kan också visas och skrivas ut.","th":"รายชื่อที่ติดต่อทั้งหมดที่มีสกุลเงินเดียวกัน งบบัญชีสามารถแสดงและพิมพ์","tr":"İlgili tüm para birimlerinin listesi. Hesap tabloları da görüntülenebilir ve basılır.","uk":"Список всіх контактів з їх відповідною валютою. Виписки також можуть бути відображені і надруковані.","vi":"Danh sách tất cả các địa chỉ liên lạc với đơn vị tiền tệ tương ứng. Báo cáo tài khoản cũng có thể được hiển thị và in."}\' WHERE id = 500001');
$db->affect('UPDATE parameter_entry SET description = \'{"sq":"Lista e të gjitha operacioneve me shumat totale të tyre në fund dhe opsionet shtesë të filtrimit pa paging. Format e operimit gjithashtu mund të shfaqen dhe të shtypen.","ar":"قائمة بجميع العمليات مع مجموع المبالغ في أسفل وخيارات تصفية إضافية دون الاستدعاء. ويمكن أيضا عرض أشكال العملية وطباعتها.","be":"Спіс усіх аперацый з іх агульнай сумы на дне і дадатковых опцый фільтрацыі без падпампоўкі. Аперацыя форма таксама можа быць адлюстравана і надрукаваная.","bg":"Списък на всички операции с техните общи суми в долната част и допълнителни опции за филтриране без пейджинг. Формулярите за работа също могат да бъдат показани и отпечатани.","ca":"Llista de totes les intervencions amb les seves quantitats totals a les opcions de filtrat de fons i addicionals sense paginació. formes d\'operació també es poden visualitzar i imprimir.","zh":"所有操作的列表，其总金额在底部，其他过滤选项没有分页。也可以显示和打印操作表格。","hr":"Popis svih operacija s njihovim ukupnim iznosima na dnu i dodatnim opcijama filtriranja bez paginga. Oblici djelovanja također se mogu prikazati i tiskati.","cs":"Seznam všech operací s jejich součtem v dolní části a další možnosti filtrování bez stránkování. Formuláře lze také zobrazit a vytisknout.","da":"Liste over alle operationer med deres samlede beløb nederst og yderligere filtreringsindstillinger uden personsøgning. Driftsformer kan også vises og udskrives.","nl":"Lijst van alle bewerkingen met hun totale bedragen aan de onderkant en extra filteropties zonder paging. Bedieningsformulieren kunnen ook worden weergegeven en afgedrukt.","en":"List of all operations with the their total amounts at the bottom and additional filtering options without paging. Operation forms can also be displayed and printed.","et":"Loetelu kõiki toiminguid koos nende kogusumma allosas ja täiendavaid suodattamistapojen ilma kutsungi. Operation vorme saab kuvada ka ja trükitud.","fi":"Luettelo kaikista toiminnoista niiden kokonaismäärien alhaalla ja ylimääräisten suodatusvaihtoehtojen avulla ilman hakua. Käyttömuotoja voidaan myös näyttää ja tulostaa.","fr":"Liste de toutes les opérations avec leurs montants totaux en bas et des options de filtrage supplémentaires sans pagination. Les formulaires d\'opération peuvent également être affichés et imprimés.","de":"Liste aller Operationen mit den Gesamtbeträgen am unteren und zusätzlichen Filteroptionen ohne Paging. Betriebsformen können auch angezeigt und ausgedruckt werden.","el":"Κατάλογος όλων των λειτουργιών με τα συνολικά τους ποσά στο κάτω μέρος και πρόσθετες επιλογές φιλτραρίσματος χωρίς την τηλεειδοποίηση. Οι φόρμες λειτουργίας μπορούν επίσης να εμφανιστούν και να εκτυπωθούν.","iw":"רשימה של כל הפעולות עם הסכומים הכולל שלהם בתחתית וסינון אפשרויות נוספות ללא החלפה. ניתן גם להציג ולהדפיס טופסי הפעלה.","hi":"पेजिंग के बिना नीचे की कुल मात्रा और अतिरिक्त फ़िल्टरिंग विकल्पों के साथ सभी कार्यों की सूची। ऑपरेशन फ़ॉर्म भी प्रदर्शित और मुद्रित किया जा सकता है।","hu":"Az összes művelet felsorolása a teljes összegek alján és a további szűrési lehetőségek lapozás nélkül. Üzemeltetési űrlapok is megjeleníthetők és kinyomtathatók.","is":"Listi yfir allar aðgerðir með heildarfjárhæðir sínar neðst og viðbótar síunarvalkostir án síðuskipta. Notkunar eyðublöð geta einnig verið birtar og prentaðar.","in":"Daftar semua operasi dengan jumlah totalnya di bagian bawah dan pilihan penyaringan tambahan tanpa paging. Bentuk operasi juga bisa ditampilkan dan dicetak.","ga":"Liosta de na hoibríochtaí go léir a bhfuil na n-méideanna iomlána ar na roghanna scagadh bun agus sa bhreis gan glaoireachta. Is féidir foirmeacha Oibríocht a chur ar taispeáint chomh maith agus a phriontáil.","it":"Elenco di tutte le operazioni con i loro importi totali in basso e opzioni aggiuntive di filtraggio senza paging. I moduli di funzionamento possono anche essere visualizzati e stampati.","ja":"ページングなしの下部および追加のフィルタリングオプションでの合計金額を含むすべての操作のリスト。操作フォームを表示して印刷することもできます。","ko":"페이징없이 맨 아래에 총 금액과 추가 필터링 옵션이있는 모든 작업 목록입니다. 작업 양식을 표시하고 인쇄 할 수도 있습니다.","lv":"Saraksts visām operācijām ar to kopsummām apakšā un papildu filtrēšanas opcijas bez peidžeru. Darbība veidlapas var arī apskatīt un izdrukāt.","lt":"Sąrašas visų operacijų su jų sumų apačioje ir papildomus filtravimo parinkčių be ieškos. Veikimo formos taip pat gali būti rodomas ir spausdinamas.","mk":"Листа на сите операции со нивната вкупна количина на дното и дополнителни опции за филтрирање без страничење. Операција форми може да бидат прикажани и печатени.","ms":"Senarai semua operasi dengan jumlah keseluruhan mereka di pilihan penapisan bawah dan tambahan tanpa kelui. bentuk operasi juga boleh dipaparkan dan dicetak.","mt":"Lista ta 'operazzjonijiet kollha mal-ammonti totali tagħhom fiż-għażliet filtrazzjoni qiegħ u addizzjonali mingħajr paging. forom operazzjoni tista 'wkoll tkun murija u stampati.","no":"Liste over alle operasjoner med deres totale beløp nederst og flere filtreringsalternativer uten personsøking. Driftsformer kan også vises og skrives ut.","pl":"Lista wszystkich operacji z ich całkowitych kwot na dole i dodatkowych opcji filtrowania bez stronicowania. Formularze operacji mogą być wyświetlane i drukowane.","pt":"Lista de todas as operações com os seus montantes totais na parte inferior e opções de filtragem adicionais sem paginação. Os formulários de operação também podem ser exibidos e impressos.","ro":"Lista tuturor operațiunilor cu sumele totale ale acestora în partea inferioară și opțiunile de filtrare suplimentare fără paginare. Formele de operare pot fi afișate și tipărite.","ru":"Список всех операций с их суммарными суммами внизу и дополнительные параметры фильтрации без разбиения по страницам. Операционные формы также могут отображаться и печататься.","sr":"Списак свих операција са својим укупним износима на дну и додатне опције за филтрирање без пагинг. Рад облици могу се приказати и штампати.","sk":"Zoznam všetkých operácií s ich celkovými čiastkami v dolnej a ďalšie možnosti filtrovania bez stránkovania. Formy prevádzky je možné zobraziť aj vytlačiť.","sl":"Seznam vseh poslov z njihovih celotnih zneskov na možnosti spodnjih in dodatnih filtriranja brez paging. oblike delovanja so lahko tudi prikaže in natisne.","es":"Lista de todas las operaciones con sus cantidades totales en la parte inferior y opciones de filtrado adicionales sin paginación. También se pueden mostrar e imprimir formularios de operación.","sv":"Lista över alla operationer med deras totala belopp längst ner och ytterligare filtreringsalternativ utan personsökning. Driftsformer kan också visas och skrivas ut.","th":"รายการการดำเนินการทั้งหมดที่มีจำนวนเงินรวมอยู่ที่ด้านล่างและตัวเลือกการกรองเพิ่มเติมโดยไม่มีเพจจิ้ง รูปแบบการดำเนินงานสามารถแสดงและพิมพ์ได้","tr":"Altındaki toplam tutarlar ve sayfalama gerektirmeyen ek filtreleme seçenekleri ile tüm işlemlerin listesi. Çalışma biçimleri de görüntülenebilir ve yazdırılabilir.","uk":"Список всіх операцій з їх загальної суми на дні і додаткових опцій фільтрації без підкачки. Операція форма також може бути відображена і надрукована.","vi":"Danh sách tất cả các hoạt động với tổng số tiền của họ ở phía dưới cùng và các tùy chọn lọc bổ sung mà không cần phân trang. Các mẫu hoạt động cũng có thể được hiển thị và in."}\' WHERE id = 500002');
