akstus var arī apskatīt un izdrukāt.","lt":"Sąrašas inventoriaus cummulative už kiekvieną elementą su savo galutinio elemento vertę ir kiekį. Prekė istorija ataskaitos taip pat gali būti rodomas ir spausdinamas.","mk":"Листа на пописот кумулативен за секој објект со нивната конечна вредност точка и квантитет. историја Точка извештаи, исто така може да бидат прикажани и печатени.","ms":"Senarai terkumpul inventori bagi setiap item dengan nilai barang akhir dan kuantiti. penyata Sejarah item juga boleh dipaparkan dan dicetak.","mt":"Lista tal-cummulative inventarju għal kull oġġett ta \'valur tagħhom oġġett finali u l-kwantità. dikjarazzjonijiet Punt istorja tista \'wkoll tkun murija u stampati.","no":"Oppgitt inventar cummulative for hvert element med deres endelige vare verdi og kvantitet. Objekthistorieuttalelser kan også vises og skrives ut.","pl":"Wymień zbiorczą sumę dla każdej pozycji o ostatecznej wartości i ilości towaru. Można również wyświetlić i wydrukować instrukcje historii przedmiotu.","pt":"Liste o cummulativo de inventário para cada item com seu valor e quantidade de item final. As declarações de histórico de itens também podem ser exibidas e impressas.","ro":"Listează cumulativ inventarul pentru fiecare articol cu ​​valoarea și cantitatea finală a articolului. Elementele istoricului de articole pot fi de asemenea afișate și tipărite.","ru":"Перечислите инвентаризацию, общую для каждого товара с их конечной стоимостью и количеством. Также можно отображать и распечатывать ведомости истории предметов.","sr":"Наведите Збирни инвентар за сваку ставку са својим коначна вредност и количине тачка. изјаве историја тачка може се приказати и штампати.","sk":"Zoznam kumulatívnych súpisov pre každú položku s hodnotou a množstvom konečnej položky. Položky histórie položiek môžu byť tiež zobrazené a vytlačené.","sl":"Seznam inventarja kumulativni za vsako točko s svojo končno vrednost in količino dobrin. Zgodovina Točka izjave se lahko prikaže in natisne.","es":"Enumere el inventario cummulativo para cada artículo con su valor y cantidad final de artículo. También se pueden mostrar e imprimir las sentencias de historial de artículos.","sv":"Lista förteckningen cummulative för varje objekt med deras slutliga artikelvärde och kvantitet. Objekthistorikutlåtanden kan också visas och skrivas ut.","th":"แสดงรายการสินค้าคงคลังสะสมสำหรับทุกรายการที่มีมูลค่าและปริมาณขั้นสุดท้ายของรายการ นอกจากนี้ยังสามารถแสดงและพิมพ์คำชี้แจงประวัติสินค้า","tr":"Envanteri, son madde değeri ve miktarı ile birlikte her maddenin kümülatif olarak listeleyin. Öğe öykü tabloları da görüntülenebilir ve basılır.","uk":"Перерахуйте cummulative інвентаризації для кожного елемента з їх остаточною вартістю і кількістю товару. заяви історії Пункту також можуть бути відображені і надруковані.","vi":"Liệt kê danh mục hàng tồn kho cho mỗi mặt hàng với giá trị và số lượng hàng hoá cuối cùng. Báo cáo lịch sử hàng cũng có thể được hiển thị và in."}\' WHERE id = 500005');
$db->affect('UPDATE parameter_entry SET description = \'{"sq":"Listoni informacionin e lëvizjeve të artikujve të mbledhura nga format përkatëse të operimit. Mund të shfaqet dhe printohet edhe forma e operimit e elementit të përzgjedhur.","ar":"قائمة المعلومات حركات البند التي تم جمعها من أشكال العملية المقابلة. يمكن أيضا عرض شكل عملية العنصر المحدد وطباعته.","be":"Пералічыце інфармацыю рухаў пункта, сабраную з адпаведных аперацыйных формаў. Аперацыя форма абранага элемента таксама можа быць адлюстравана і надрукаваная.","bg":"Посочете информацията за движението на елементите, събрана от съответните формуляри за работа. Формата на операцията на избрания елемент също може да бъде показана и отпечатана.","ca":"Enumerar la informació recopilada dels moviments d\'articles formes d\'operació corresponent. forma de funcionament de l\'element seleccionat també es pot visualitzar i imprimir.","zh":"列出从相应的操作表单收集的项目移动信息。所选项目的操作形式也可以显示和打印。","hr":"Navedite podatke o kretanju stavki prikupljenih iz odgovarajućih obrasca operacija. Također se može prikazati i ispisati oblik rada odabrane stavke.","cs":"Uveďte informace o pohybech položek získaných z příslušných formulářů. Provozní formulář vybrané položky lze také zobrazit a vytisknout.","da":"Angiv varebevægelsesoplysningerne indsamlet fra de tilsvarende driftsformer. Driftsformularen for det valgte emne kan også vises og udskrives.","nl":"Maak een lijst van de objectbewegingsinformatie verzameld uit overeenkomstige werkvormen. Werkingsvorm van het geselecteerde item kan ook worden weergegeven en afgedrukt.","en":"List the item movements information collected from corresponding operation forms. Operation form of the selected item can also be displayed and printed.","et":"Nimekiri objekti liikumise kogutud teavet vastava operatsiooni vorme. Operatsioon vormis valitud elemendi saab kuvada ka ja trükitud.","fi":"Luettelo liikkeeseenlaskujen tiedoista, jotka on kerätty vastaavista toimintolomakkeista. Valitun kohteen toimintomuoto voidaan myös näyttää ja tulostaa.","fr":"Énumérer les informations sur les mouvements d\'objets recueillies à partir des formulaires d\'opération correspondants. La forme d\'opération de l\'élément sélectionné peut également être affichée et imprimée.","de":"Auflisten der Artikelbewegungsinformationen aus entsprechenden Betriebsformularen. Die Betriebsform des ausgewählten Artikels kann auch angezeigt und ausgedruckt werden.","el":"Καταγράψτε τις πληροφορίες σχετικά με τις κινήσεις αντικειμένων που συλλέγονται από τις αντίστοιχες φόρμες λειτουργίας. Μπορείτε επίσης να εμφανίσετε και να εκτυπώσετε τη φόρμα λειτουργίας του επιλεγμένου στοιχείου.","iw":"רשום את פרטי תנועות הפריט שנאספו מטופסי הפעולה המתאימים. ניתן גם להציג ולהדפיס את טופס הפעולה של הפריט שנבחר.","hi":"संबंधित संचालन रूपों से एकत्र की गई आइटम आंदोलनों की सूची सूचीबद्ध करें। चयनित आइटम का ऑपरेशन फॉर्म भी प्रदर्शित और मुद्रित किया जा सकता है।","hu":"Sorolja fel a megfelelő műveleti űrlapokból gyűjtött elemmozgások adatait. A kijelölt elem működési formája is megjeleníthető és kinyomtatható.","is":"Skráðu upplýsingar um hreyfingar hreyfingarinnar sem safnað er frá samsvarandi aðgerðareyðublöðum. Einnig er hægt að sýna aðgerð mynd af völdum hlutanum og prenta það.","in":"Cantumkan informasi gerakan item yang dikumpulkan dari formulir operasi yang sesuai. Bentuk operasi dari item yang dipilih juga bisa ditampilkan dan dicetak.","ga":"Déan liosta de na t-eolas gluaiseachtaí mír bhailítear ó fhoirmeacha oibriú comhfhreagrach. Is féidir an fhoirm Feidhmiú an mhír roghnaithe a chur ar taispeáint chomh maith agus a phriontáil.","it":"Elenca le informazioni relative ai movimenti degli elementi raccolti da forme di funzionamento corrispondenti. È anche possibile visualizzare e stampare la forma di funzionamento dell\'elemento selezionato.","ja":"対応する作業フォームから収集された品目移動情報を一覧表示します。選択した項目の操作フォームを表示して印刷することもできます。","ko":"해당 작업 양식에서 수집 한 항목 이동 정보를 나열하십시오. 선택한 항목의 조작 양식을 표시하고 인쇄 할 수도 있습니다.","lv":"Uzskaitiet prece kustības informāciju, kas apkopota no atbilstošā ekspluatācijas formas. Darbība forma izvēlētā objekta var arī apskatīt un izdrukāt.","lt":"Sąrašas elementą judesius Informacija, surinkta iš atitinkantis eksploatavimo formas. Operacija forma pasirinkto elemento, taip pat gali būti rodomi ir spausdinami.","mk":"Листа на информации од движењата точка собрани од соодветните операција форми. Операција форма на избраната ставка исто така може да бидат прикажани и печатени.","ms":"Menyenaraikan maklumat pergerakan item yang dikumpul daripada sama bentuk operasi. bentuk operasi item yang dipilih juga boleh dipaparkan dan dicetak.","mt":"Lista l-movimenti oġġett informazzjoni miġbura minn forom operazzjoni korrispondenti. forma operat tal-oġġett magħżula jistgħu wkoll jiġu murija jew stampata.","no":"Oppgi varebevegelsesinformasjonen samlet inn fra tilsvarende operasjonsformer. Driftsform for det valgte elementet kan også vises og skrives ut.","pl":"Wykaz informacji o ruchach elementów zebranych w odpowiednich formularzach. Można również wyświetlić i wydrukować formularz operacji wybranego elementu.","pt":"Liste as informações de movimentos de itens coletadas dos formulários de operação correspondentes. O formulário de operação do item selecionado também pode ser exibido e impresso.","ro":"Listați informațiile despre mișcările de articole colectate din formularele de operare corespunzătoare. Forma de operare a elementului selectat poate fi afișată și imprimată.","ru":"Перечислите информацию о перемещениях предметов, полученную из соответствующих форм операций. Форма операции выбранного элемента также может отображаться и печататься.","sr":"Наведите информације итем покрете прикупљене од одговарајућих оперативних облика. Рад облик изабране ставке могу се приказати и штампати.","sk":"Uveďte informácie o pohyboch položiek získaných z príslušných formulárov. Môžete tiež zobraziť a vytlačiť prevádzkovú formu zvolenej položky.","sl":"Seznam pomikov postavka podatke, zbrane iz ustrezne oblike